css:
@-moz-document domain("projectdxxx.me") {
body
{
    background-color: #272727;
    color: #b7b7b7; }

.panel
{
    background-color: #212121;
    border: 1px solid rgb(0, 0, 0);
    -webkit-box-shadow: 0 1px 1px rgba(0, 0, 0, .05);
    box-shadow: 0 1px 1px rgba(0, 0, 0, .05); }

.table-striped > tbody > tr:nth-child(odd)
{
    background-color: #f9f9f900; }

.panel-default > .panel-heading
{
    border-color: #000; }

.ScoreTop.Mod
{
    background: #FDC92E;
    background: -ms-linear-gradient(top, #FDC92E 0%, #E5B629 100%);
    background: -webkit-linear-gradient(top, #250bffde 0%, #e5b62900 100%); }


.panel > .panel-body + .table,
.panel > .panel-body + .table-responsive,
.panel > .table + .panel-body,
.panel > .table-responsive + .panel-body
{
    border-top: 1px solid #000; }



.table > thead > tr > th,
.table > tbody > tr > th,
.table > tfoot > tr > th,
.table > thead > tr > td,
.table > tbody > tr > td,
.table > tfoot > tr > td
{
    border-top: 1px solid #000; }


.form-control
{
    color: #555;
    background-color: rgb(34, 34, 34);
    border: 1px solid #9d9d9d; }


.input-group-addon
{
    color: #9d9d9d;
    background-color: #222;
    border: 1px solid #9d9d9d; }


.btn-default
{
    color: #9d9d9d;
    background-color: #fff0;
    border-color: #ccc0; }

.pagination > li > a,
.pagination > li > span
{
    color: #6d6d6d;
    background-color: #fff;
    border: 1px solid #a2a2a200; }


.pagination > .active > a,
.pagination > .active > span,
.pagination > .active > a:hover,
.pagination > .active > span:hover,
.pagination > .active > a:focus,
.pagination > .active > span:focus
{
    color: #fff;
    background-color: #81818196;
    border-color: #2220; }

.pagination > li > a,
.pagination > li > span
{
    text-decoration: none;
    background-color: #fff0; }

.pagination > .disabled > span,
.pagination > .disabled > span:hover,
.pagination > .disabled > span:focus,
.pagination > .disabled > a,
.pagination > .disabled > a:hover,
.pagination > .disabled > a:focus
{
    color: #777;
    cursor: not-allowed;
    background-color: #d8000000;
    border-color: #ddd0; }


.ScoreTop.AC
{
    background: #A8DDEC;
    background: -ms-linear-gradient(top, #B1F1FF 0%, #A8DDEC 100%);
    background: -webkit-linear-gradient(top, #00d1ffad 0%, #a8ddec00 100%); }

a
{
    color: #cccaca;
    text-decoration: none; }

.ScoreTop.ACFT
{
    background: #ECCBA8;
    background: -ms-linear-gradient(top, #FFD9B1 0%, #ECCBA8 100%);
    background: -webkit-linear-gradient(top, #ff8300b3 0%, #eccba800 100%); }

.panel-default > .panel-heading
{
    color: #cccacaa8; }

.navbar-inverse .navbar-nav > .active > a,
.navbar-inverse .navbar-nav > .active > a:hover,
.navbar-inverse .navbar-nav > .active > a:focus
{
    color: #fff;
    background-color: #5c5c5c; }

.panel-default > .panel-heading
{
    background-color: #58585800; }

.panel-footer
{
    background-color: #212121;
    border-top: 1px solid #000; }

hr
{
    border-top: 1px solid #eee0; }

.ScoreTop.Skin
{
    background: #C9FD2E;
    background: -ms-linear-gradient(top, #C9FD2E 0%, #B6E529 100%);
    background: -webkit-linear-gradient(top, #62ff00b8 0%, #b6e52900 100%); }



body > div.container
{
    background: rgba(34, 34, 34, 0);
    padding: 10px;
    border-radius: 10px; }

.list-group-item
{
    background-color: #222;
    border: 1px solid #888; }

.form-control
{
    color: #e8e8e8; }

a.list-group-item
{
    color: #cecece; }

.navbar-default
{
    background-color: #f8f8f800;
    border-color: #888888; }

.form-control[disabled],
.form-control[readonly],
fieldset[disabled] .form-control
{
    background-color: #eee0; }

.modal-content
{
    background-color: #3c3c3c; }

a.list-group-item .list-group-item-heading
{
    color: #f5f5f5; }
}
